import { createRouter, createWebHistory } from 'vue-router';

import HomePage from '@/pages/HomePage.vue';
import ApplicationFormPage from '@/pages/ApplicationFormPage.vue';
import ApplyNowPage from '@/pages/ApplyNowPage.vue';
import CostBreakdownPage from '@/pages/CostBreakdownPage.vue';
import OrdersListPage from '@/pages/OrdersListPage.vue';
import PaymentPage from '@/pages/PaymentPage.vue';
import ProfilePage from '@/pages/ProfilePage.vue';
import ReportPage from '@/pages/ReportPage.vue';
import TrackVisaPage from '@/pages/TrackVisaPage.vue';

const routes = [
    { path: '/', component: HomePage, name: 'Home' },
    { path: '/application-form', component: ApplicationFormPage, name: 'ApplicationForm' },
    { path: '/apply-now', component: ApplyNowPage, name: 'ApplyNow' },
    { path: '/cost-breakdown', component: CostBreakdownPage, name: 'CostBreakdown' },
    { path: '/orders-list', component: OrdersListPage, name: 'OrdersList' },
    { path: '/payment', component: PaymentPage, name: 'Payment' },
    { path: '/profile', component: ProfilePage, name: 'Profile' },
    { path: '/reports', component: ReportPage, name: 'Reports' },
    { path: '/track-visa', component: TrackVisaPage, name: 'TrackVisa' }
];

const router = createRouter({
    history: createWebHistory(),
    routes
});

export default router;
